import React, { useEffect } from 'react';
import axios from 'axios';

export default function ShowMenuItem(props) {
    useEffect(() => {
        axios.get('http://localhost:3000/api/menu/item', { params: { menuItem: props.menuItem } })
            .then(res => {
                console.log(res.data);
                this.setState({ itemConfig: res });
            });
    }), [];

    return (<div>{this.state.itemConfig.map((m, key) =>
        <button className="btn btn-primary m-1">
            <p>{m.size1}</p>
        </button>)}
    </div>);
}
